// src/Navbar.jsx
import React from "react";
import { FaMoon, FaSun } from "react-icons/fa";

const Navbar = ({ darkMode, toggleDarkMode }) => {
  const navLinks = ["Home", "Skills", "Projects", "Experience", "Blog", "Contact"];

  return (
    <header
      className={`fixed top-0 w-full z-50 shadow-md transition duration-300 ${
        darkMode ? "bg-gray-900 text-white" : "bg-white text-gray-800"
      }`}
    >
      <div className="container mx-auto px-6 py-3 flex justify-between items-center">
        <div className="text-2xl font-bold text-blue-500">Harsh.</div>

        <nav className="hidden md:flex space-x-6 text-lg">
          {navLinks.map((link) => (
            <a
              key={link}
              href={`#${link.toLowerCase()}`}
              className="hover:text-blue-500 transition-colors duration-300"
            >
              {link}
            </a>
          ))}
        </nav>

        <button
          onClick={toggleDarkMode}
          className="text-xl p-2 rounded-full hover:bg-gray-200 dark:hover:bg-gray-700 transition"
        >
          {darkMode ? <FaSun /> : <FaMoon />}
        </button>
      </div>
    </header>
  );
};

export default Navbar;
